import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Route,NavLink,BrowserRouter as Router,Switch} from "react-router";
import Plank from "../dashboard/Plank";
import Article from "../dashboard/Article";
import Notfound from "../dashboard/Notfound";
import Home from "../dashboard/Home";
import Post from "../dashboard/Post";

class Navbar extends Component {
    render() {
      return (


        <Router>
          <div >
            <ul>
            <li>
                  <NavLink  to="/dashboard/home">
                    Home
                  </NavLink>
                </li>
                <li>
                  <NavLink  to="/dashboard/article">
                    Article
                  </NavLink>
                </li>
                <li>
                  <NavLink to="/dashboard/plank">
                  plank
                  </NavLink>
                </li>
                <li>
                  <NavLink to="/dashboard/post">
                  Post
                  </NavLink>
                </li>
              </ul>
              <Switch>

                <Route exact path="/dashboard/home" component={Home} />
                <Route exact path="/dashboard/plank" component={Plank} />
                <Route exact path="/dashboard/post" component={Post} />
                <Route exact apath="/dashboard/article" component={Article} />
                <Route exact path="/404" component={Notfound} />
              </Switch>
              </div>
      </Router>


      );
    }
  }

export default Navbar;
